package leetCode.contest;

import java.util.HashSet;
import java.util.Set;

public class H_Weekly5367 {
    public static String longestPrefix(String s) {
        String result = "";
        int max=0;
        Set<String> prefix = new HashSet<>();
        Set<String> sufix = new HashSet<>();
        for( int i = 0 ; i < s.length(); i++){
            prefix.add(s.substring(0,i));
            sufix.add(s.substring(s.length()-i,s.length()));
        }
        System.out.println(prefix.toString());
//        System.out.println(sufix.toString());
        prefix.retainAll(sufix);
        for (String value: prefix){
            if (value.length()> max){
                max = value.length();
                result = value;
            }
        }
        return result;
    }

    public static void main(String[] args) {
        String input = "";
        System.out.println(longestPrefix(input));
    }
}
